import React from 'react';
import ValueChanger from "./ValueChanger";
function Client(props){
    let propertiesList = [];
    const sendChange= (newValue) => {
        props.onValueChange(newValue);
    }
    for(const [property, value] of Object.entries(props.properties)){
        console.log(property + " | " + value);
        propertiesList.push(
            // <li key={property} >
               // <ValueChanger property={property} value={value} onValueChange={sendChange}></ValueChanger>
            // </li>
            React.createElement(ValueChanger,{property:property, value:value, onValueChange:sendChange})
        )
    }

    console.log(propertiesList[0]);
    const x = propertiesList;
    return(
        // <ul>
            //{propertiesList}
        // </ul>
        // {propertiesList}
       x.map(h => {h.value})
    )
}

export default Client;
